import ProteomicsWork from "./Proteomics.jpg";
import BatteryWork from "./BatteryWork.png";
import InboundWork from "./Inbound.png";
import BastiatWork from "./BastiatPartners.jpg";
import NorthwesternWork from "./NorthwesternWork.jpg";

import GitHubIcon from "./GitHub.png";
import LinkedInIcon from "./LinkedInLogo.png";
import DownloadIcon from '@mui/icons-material/Download';
import EmailIcon from '@mui/icons-material/Email';

import HomeLogo from "./Logo.png";

import Button from "@mui/material/Button";
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';
import CssBaseline from "@mui/material/CssBaseline";
import Container from "@mui/material/Container";
import { ArrowForward, GitHub } from "@mui/icons-material";

const ImgNoMargin = styled("img")({
	maxWidth: "100%",
	maxHeight: "100%",
});

var TxtRotate = function(el, toRotate, period) {
	this.toRotate = toRotate;
	this.el = el;
	this.loopNum = 0;
	this.period = parseInt(period, 100) || 4000;
	this.txt = '';
	this.tick();
	this.isDeleting = false;
  };

  TxtRotate.prototype.resetRotation = function() {
	this.loopNum = 0;
	this.txt = '';
	this.isDeleting = false;
	this.tick();
  };

  TxtRotate.prototype.tick = function() {
	var i = this.loopNum % this.toRotate.length;
	var fullTxt = this.toRotate[i];

	if (this.isDeleting) {
	  this.txt = fullTxt.substring(0, this.txt.length - 1);
	} else {
	  this.txt = fullTxt.substring(0, this.txt.length + 1);
	}

	this.el.innerHTML = '<span class="wrap">' + this.txt + '</span>';

	var that = this;
	var delta = 150 - Math.random() * 100;

	if (this.isDeleting) {
	  delta /= 2;
	}

	if (!this.isDeleting && this.txt === fullTxt) {
	  delta = this.period;
	  this.isDeleting = true;
	} else if (this.isDeleting && this.txt === '') {
	  this.isDeleting = false;
	  this.loopNum++;
	  delta = 1000;
	}

	setTimeout(function () {
	  that.tick();
	}, delta);
  };

  window.onload = function () {
	var elements = document.getElementsByClassName('txt-rotate');
	var txtRotateInstances = [];

	for (var i = 0; i < elements.length; i++) {
	  var toRotate = elements[i].getAttribute('data-rotate');
	  var period = elements[i].getAttribute('data-period');
	  var instance = new TxtRotate(elements[i], JSON.parse(toRotate), period);
	  txtRotateInstances.push(instance);
	}

	// INJECT CSS
	var css = document.createElement('style');
	css.type = 'text/css';
	css.innerHTML = '.txt-rotate > .wrap { border-right: 0.08em solid #1b4332 }';
	document.body.appendChild(css);

	// Reset rotation on window resize
	window.addEventListener('resize', function () {
	  var windowWidth = window.innerWidth;
	  var condition = windowWidth >= 1075;

	  txtRotateInstances.forEach(function (instance) {
		if (condition) {
		  instance.resetRotation();
		}
	  });
	});
  };  

const Main = () => {
	const [windowWidth, setWindowWidth] = useState(window.innerWidth);

	useEffect(() => {
		const handleResize = () => {
		setWindowWidth(window.innerWidth);
		};

		window.addEventListener('resize', handleResize);

		return () => {
		window.removeEventListener('resize', handleResize);
		};
	}, []);

    return (
		<div className="view">
			<div 
				style={{
					backgroundColor: "#f0fff1",
					minWidth: "calc(100vw - 40px)",
					minHeight: "calc(100vh - 40px)",
					position: "relative",
					overflow: "hidden"
				}}
			>
				<div
					style={{
						zIndex: 10000,
						display: "flex",
						justifyContent: "space-between",
						alignItems: "center",
						width: "calc(100vw - 160px)",
						backgroundColor: "#f0fff1",
						padding: "15px 60px 15px",
						position: "fixed"
					}}
				>
					<a href="/">
						<img src={HomeLogo} width={"60px"} alt='Logo' />
					</a>
					<div
						style={{
							display: "flex",
							alignItems: "center"
						}}
					>	
						<a href="https://github.com/mkim45" target="_blank" rel="noopener noreferrer" underline="none">
							<ImgNoMargin
								alt="githubtop"
								src={GitHubIcon}
								sx={{ height: "40px", width: "40px", paddingRight: "20px" }}
							/>
						</a>
						<a href="https://www.linkedin.com/in/michael-kim-nu/" target="_blank" rel="noopener noreferrer" underline="none">
							<ImgNoMargin
								alt="linkedintop"
								src={LinkedInIcon}
								sx={{ height: "40px", width: "40px" }}
							/>
						</a>
					</div>
				</div>
				<div 
					style={{ 
						marginLeft: "60px",
						marginRight: "60px"
					}}
				>
					{windowWidth >= 1075 ? (
						<div
							style={{
								minHeight: "100%",
								paddingTop: "69px",
								display: "flex",
								alignItems: "center",
								overflow: "hidden",
								justifyContent: "space-between",
								maxWidth: "1200px",
								margin: "0px auto"
							}}
						>
							<div
								style={{
									height: "25vh",
									maxWidth: "100%",
								}}
							>
								<h1
									style={{
										fontSize: "72px",
										fontFamily: "Bitter, serif",
										fontWeight: "normal",
										color: "#1b4332",
										margin: "0px"
									}}
								>
									Hi, my<br></br>name is <b>Michael</b><span style={{ color: "#52b788" }}>.</span>
								</h1>
								<p
									style={{
										fontSize: "24px",
										maxWidth: "525px",
										marginTop: "30px",
										lineHeight: 1.65,
										color: "#1b4332"
									}}
								>
									I'm a <b>software engineer</b> and <b>data scientist</b> interested in improving human experiences through&nbsp;
									<span class="txt-rotate"
										style={{
											fontWeight: "bold",
											color: "#1b4332"
										}} 
										data-period="1500"
										data-rotate='["multiomics.&nbsp;", "machine learning.&nbsp;", "startups.&nbsp;", "software development.&nbsp;", "bioinformatics.&nbsp;"]'>
									</span>
								</p>
							</div>
							<div
								style={{
									marginTop: "60px",
								}}
							>
								<ImgNoMargin
									alt="portrait"
									src={Portrait}
									sx={{ height: "525px", width: "350px" }}
								/>
							</div>
						</div>
					) : (
						<div
							style={{
								minHeight: "100%",
								paddingTop: "89px",
								display: "flex",
								alignItems: "center",
								overflow: "hidden",
								justifyContent: "space-between",
								maxWidth: "1200px",
								margin: "0px auto",
								flexDirection: "column"
							}}
						>
							<div
								style={{
									display: "flex", justifyContent: "center"
								}}
							>
								<ImgNoMargin
									alt="portrait"
									src={Portrait}
									sx={{ height: "350px", width: "233.33px" }}
								/>
							</div>
							<div
								style={{
									marginTop: "30px",
								}}
							>
								<div
									style={{
										minHeight: "25vh",
										maxWidth: "100%",
										display: "flex",
										textAlign: "center",
										justifyContent: "center",
										flexDirection: "column"
									}}
								>
									<h1
										style={{
											fontSize: "72px",
											fontFamily: "Bitter, serif",
											fontWeight: "normal",
											color: "#1b4332",
											margin: "0px"
										}}
									>
										Hi, my name<br></br>is <b>Michael</b><span style={{ color: "#52b788" }}>.</span>
									</h1>
									<p
										style={{
											fontSize: "24px",
											maxWidth: "525px",
											marginTop: "30px",
											lineHeight: 1.65,
											color: "#1b4332"
										}}
									>
										I'm a <b>software engineer</b> and <b>data scientist</b> interested in improving human experiences through&nbsp;
										<span class="txt-rotate"
											style={{
												fontWeight: "bold",
												color: "#1b4332"
											}} 
											data-period="1500"
											data-rotate='["multiomics.&nbsp;", "machine learning.&nbsp;", "startups.&nbsp;", "software development.&nbsp;", "bioinformatics.&nbsp;"]'>
										</span>
									</p>
								</div>
							</div>
						</div>
					)}
					{windowWidth >= 1075 ? (
						<div
							style={{
								margin: "100px auto 0px",
								flexDirection: "row",
								justifyContent: "space-between",
								display: "flex",
								maxWidth: "1200px"
							}}
						>
							<div
								style={{
									width: "60%"
								}}
							>
								<div
									style={{
										position: "relative",
										marginBottom: "36.5px"
									}}
								>
									<h2
										style={{
											fontSize: "64px",
											fontFamily: "Bitter, serif",
											fontWeight: "bold",
											color: "#1b4332",
											margin: "0px"
										}}
									>
										About me<span style={{ color: "#52b788" }}>.</span>
									</h2>
									<div
										style={{
											width: "80px",
											height: "3.5px",
											backgroundColor: "#52b788",
											marginTop: "10px"
										}}
									></div>
								</div>
								<div
									style={{
										margin: "0px auto",
										position: "relative"
									}}
								>
									<p
										style={{
											fontSize: "17px",
											marginTop: "0px",
											lineHeight: 1.65,
											color: "#1b4332",
											marginBottom: "25px"
										}}
									>
										Im a <b>third-year undergraduate student</b> at Northwestern University, pursuing a B.A. in Biology and Data Science 
										and an M.S. in Computer Science through a B.A./M.S. program.<br/><br/>
										While initially exploring investment banking and venture capital internships, I found myself far more passionate 
										about the transformative work of the startups I was actually advising and sourcing. Since then, Ive been fortunate to build 
										software for a <b>multiomics research lab</b>, a <b>venture capital firm</b>, and a <b>startup</b>. I'm eager to continue 
										imparting meaningful impact, particularly at innovative and disruptive startups.<br/><br/>
										Currently, Im leading a project at the <b>Proteomics Center of Excellence</b> to reverse engineer and improve Thermo Fisher Scientifics mass 
										spectrometry software. On the side, Ive been creating a multiomics quality control tool with <b>autoencoder neural network models</b>.<br/><br/>
										While Im not coding, I enjoy playing tennis, learning new languages, spending time outdoors with friends, and reading books on human behavior. 
									</p>
								</div>
							</div>
							<div
								style={{
									marginTop: "114px"
